values:
I should've known that our friendship was doomed from the start.&nbsp; Although it seemed as though we had a lot in common, we were as different as a hummus pita pocket and a ham n roast beef sammich.&nbsp; Ok, probably a bit more alike than that, but you get the idea.&nbsp; It seemed like a grand idea, and we even looked a lot alike, too, which made it seem as though we definitely should've been friends, when everyone thought we were related anyway.&nbsp; 

Bad idea.

I realized today what the problem was, and that we should've seen it from the start.&nbsp; I realized how obvious it was that we were two people from totally different planets, as it were.&nbsp; I discovered it as I was thinking about our role models.&nbsp; She idolized Audrey Hepburn. Me?&nbsp; I want to be like Angelina Jolie when I grow up.&nbsp; She wanted that grace, beauty, style.&nbsp; I want that oozing sexuality, wit, and confidence.&nbsp; She wants to be charming, I want to be a badass.&nbsp; In reality, I'm probably more charming than it sounds... I mean, I don't (usually) burp loud enough to silence a restaurant, and I know my pleases and thank yous.&nbsp; But if I had a choice of whose body I could step into... Angelina, baby, all the way.&nbsp; Well, she's the one that I bring up, because she's pretty much the embodiment of what I'd like to be.&nbsp; Eliza Dushku, Angelina Jolie, Jessia Biel in trinity (I have to specify with her, she's not always the badass)... those are who I look up to.&nbsp; Those are the people I wish I were like.&nbsp; I want to be that kind of girl.&nbsp; In reality, I'm not so much, but I like to think I have the heart of a badass girl.&nbsp; It just doesn't show on the outside.&nbsp; But I digress.&nbsp; 

That is why I'm going to have to make it a point to check with all my friends about who they look up to, want to be like, etc.&nbsp; I can't have another Audrey Hepburn debacle on my hands now, can I?
